import './App.css';
import React from 'react';
import SearchPage from './SearchPage.js'

class App extends React.Component {
  constructor(props) {
    super(props);

    this.setState({curPage: "searchPage"});
  }

  render() {
    switch(this.state.curPage) {
      default:
        this.setState({curPage: "searchPage"});
      case "searchPage":
        return SearchPage
    }
  }
}

export default App;
